import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

import './styles.css';

const Results = props => {
  console.log(props.location.state);

  const {
    firstName,
    originCityId,
    orignCityName,
    destCityId,
    destCityName,
    depDate,
    returnDate
  } = props.location.state;
  return (
    <>
      <Container>
        <div id='results-page-wrapper'>
          <h1 id='results-header'>You're all set for a great trip!</h1>
          <div class='divider'></div>
        </div>
        <Row id='trip-info-wrapper'>
          <Col>
            <div class='trip-info-section'></div>
          </Col>
          <Col>
            <div class='trip-info-section'></div>
          </Col>
          <Col>
            <div class='trip-info-section'></div>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Results;
